post_text:
Ron Keller, Sweet Corn Festival Chairman, is in the process of locating past Sweet Corn Festival Queens in preparation for their 75th Anniversary in 2021. He is looking for a mailing address, telephone number or email for the following queens:

1995: Anne Vannest Roehlig;

1965: Rosalie Clark Parkinson;

1972: Vicky Wood Davis;

1998: Brittany Young.

If anyone has contact information for any of the above women, please send us a private message with the information and we will pass it along to Ron.

